var __index = {"config":{"lang":["en"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"Home","text":""},{"location":"index.html#welcome-to-driftys-docs","title":"Welcome to drifty's docs!","text":"<p>Hey there! I curate a bunch of links for stuff on here, and try to represent what I have learnt so others can also follow my steps</p>"},{"location":"index.html#stuff-to-check-out","title":"Stuff to check out","text":"<ul> <li>My Services</li> </ul>"},{"location":"index.html#other-links","title":"Other Links","text":"<ul> <li>zx's archive for iOS sideloading</li> <li>inotia00's ReVanced Extended for Android</li> </ul>"},{"location":"blog/index.html","title":"Blog","text":""},{"location":"blog/2024/06/19/welcome-to-my-docs.html","title":"Welcome to my docs!","text":"<p>This place should serve as a link bucket mainly, for stuff I host or own, but it will also have handy guides to do everything I did with steps etc.</p> <p>This is new, I'm still figuring it out, please bear with me and hopefully this is fruitful.</p>"},{"location":"links/index.html","title":"Index","text":"<p>Click on whatever category you want to see: -</p>"},{"location":"links/index.html#-movies-tv-shows","title":"- Movies / TV Shows","text":""},{"location":"links/index.html#-music-audibooks","title":"- Music / Audibooks","text":""},{"location":"links/TV/links.html","title":"Links","text":""},{"location":"links/TV/links.html#streaming","title":"Streaming","text":"<ul> <li>Braflix \u2b50</li> </ul>"},{"location":"links/TV/links.html#downloads","title":"Downloads","text":""},{"location":"links/music/links.html","title":"Links","text":""},{"location":"links/music/links.html#streaming","title":"Streaming","text":""},{"location":"links/music/links.html#apps","title":"Apps","text":"<ul> <li>Blackhole \u2b50</li> </ul>"},{"location":"links/music/links.html#sites","title":"Sites","text":""},{"location":"links/music/links.html#downloading","title":"Downloading","text":""},{"location":"links/music/links.html#apps_1","title":"Apps","text":""},{"location":"links/music/links.html#sites_1","title":"Sites","text":"<ul> <li>doubledouble \u2b50</li> </ul>"},{"location":"services/android.html","title":"Android","text":"<p>I mainly deal with patching and releasing the latest version of modified YouTube (ReVanced, RVX or ReX).</p>"},{"location":"services/android.html#github-releases","title":"GitHub Releases","text":"<p>I host barebones repositories that are compatible with Obtanium for automatic updates on Android phones. They are as follows: -</p> <ul> <li>YouTube builds</li> <li>YouTube Music builds</li> <li>MiXplorer releases (to be established)</li> </ul>"},{"location":"services/android.html#telegram-releases","title":"Telegram Releases","text":"<ul> <li>Latest releases of modified YouTube builds are available to download on my dedicated Telegram channel here or in the ReVanced builds topic here.</li> <li>Latest releases of modified Spotify builds from xManager (essentially a repost channel) are available here. </li> <li>Latest releases of Minecraft (MCPE) with working online can be found here.</li> </ul>"},{"location":"services/android.html#reddit-lemmy-releases","title":"Reddit / Lemmy Releases","text":"<ul> <li>I release my builds for people who are not super tech savvy and rely on Reddit for updates here as a fallback (I am u/fakedoorsarereal).</li> <li>I also release builds on Lemmy regularly here.</li> </ul>"},{"location":"services/deta.html","title":"Deta Space","text":"<p>I have setup quite a few projects that run on Deta's cloud and they are more or less stable to use.</p>"},{"location":"services/deta.html#utilities","title":"Utilities","text":"<ul> <li>Wastebin (Open Source pastebin alternative)</li> <li>URL Shortener (cloed to the public)</li> <li>Snapdrop</li> <li>VSCode Online</li> </ul>"},{"location":"services/deta.html#privacy-focused-stuff","title":"Privacy focused stuff","text":"<ul> <li>Ultraviolet Proxy</li> <li>Cobalt Proxy</li> </ul>"},{"location":"services/ios.html","title":"iOS","text":"<p>I mainly deal with sideloading on a very surface level that too.</p>"},{"location":"services/ios.html#altstore-source-viewer","title":"AltStore Source Viewer","text":"<ul> <li>I run this project on my own in two versions - GitHub pages version and Cloudflare Pages version.</li> </ul>"},{"location":"services/ios.html#repositories-altstore-esign-trollapps","title":"Repositories (AltStore, Esign, TrollApps)","text":"<ul> <li>I update my AltStore Repository regularly whith a bunch of usefull sideloadable apps.</li> <li>If the AltStore Repository does not work already, I have dedicated repos for ESign and TrollApps too.</li> <li>I have an alternate AltStore repo specifically for YTLitePlus.</li> </ul>"},{"location":"services/ios.html#mirrors-backups","title":"Mirrors / Backups","text":"<ul> <li>Mirrors to all of the above exist as a file server here and on Telegram here.</li> </ul>"},{"location":"services/ios.html#useful-links-for-sideloading","title":"Useful links for sideloading","text":"<p>Here are some of the resources I have started depending on for my sideloading needs.</p> <ul> <li>uYouEnhanced GitHub repo</li> <li>YTLitePlus GitHub repo</li> <li>AppTesters Telegram Group with IPA decryptor bot</li> <li>armconverter site with decrypted IPAs</li> </ul>"},{"location":"services/misc.html","title":"Miscellaneous","text":"<p>Here is some stuff I host on VPSs.</p>"},{"location":"services/misc.html#utilities","title":"Utilities","text":"<ul> <li>My Bitwarden Instance (closed to the public)</li> <li>movie-web instance</li> <li>year progress bar and month progress bar</li> <li> <p>custom progress bar (repo) </p> <p>Customize \"My%20Project\" for title and start and end dates in the URL to make your own progress bar of a time perod in this template: - </p> <p><code>https://progress.003274.xyz/?title=My%20Project&amp;startdate=2023-02-05&amp;enddate=2024-04-06</code></p> </li> <li> <p>Cobalt Downloader (supports downloading from a bunch of social media websites)</p> </li> </ul>"},{"location":"services/misc.html#software","title":"Software","text":"<ul> <li>Auto-updating Cromite for PC (just extract the latest release and run <code>chrlauncher.exe</code> in <code>\\chrlauncher\\64\\</code> everytime to update and run Cromite)</li> </ul>"},{"location":"services/misc.html#games","title":"Games","text":"<ul> <li>Wordle (can die anytime lol)</li> </ul>"},{"location":"blog/archive/2024.html","title":"2024","text":""}]}